import React, { useState } from "react";
import { Nav } from "react-bootstrap/";
import LogoImg from "../resource/images/header_logo.png";
import BodyContainer from "./BodyContainer";
import FlexBox from "./FlexBox";

const Header = () => {
    const [tabCurrent, setTabCurrent] = useState(0);
    const headerMenu = [
        {
            index: 0,
            title: "메인",
        },
        {
            index: 1,
            title: "게시판",
        },
        {
            index: 2,
            title: "자취생활",
        },
    ];

    return (
        <BodyContainer className="border-b-[1px] bg-white">
            <FlexBox justify="space-between" className="h-[60px] md:h-[100px]">
                <FlexBox className="h-full">
                    <img src={LogoImg} alt="" className="h-[40px] md:h-[70px] md:pr-8" />
                    <Nav
                        className="h-full flex bg-black"
                        activeKey="/home"
                        onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
                    >
                        {headerMenu.map((item, index) => (
                            <Nav.Item key={index} className="h-full">
                                <FlexBox align="center" justify="center" className="pr-4">
                                    <Nav.Link href="/home" className="h-full">
                                        {item.title}
                                    </Nav.Link>
                                </FlexBox>
                            </Nav.Item>
                        ))}

                        {/* eventKey="disabled" */}
                    </Nav>
                </FlexBox>
                <div>qdqd</div>
            </FlexBox>
        </BodyContainer>
    );
};

export default Header;
